import React, {PureComponent} from 'react'
import './style.css'

class Adding extends PureComponent {
  render() {
    return (
      <div class="form-group">
        <h4>Регистрация:</h4>
        <div>Имя:<input id="emailInput" type="text" placeholder="Имя" /></div>
        <div>Пароль:<input id="passwordInput" type="password" placeholder="Введите пароль" /></div>
        <p>Повтор пароля:<input id="rep-passwordInput" type="password" placeholder="Повторите пароль" /></p>
        <button  id="clearButton1" type="button" name="button">Отправить</button>
      </div>
    )
  }
}

export default Adding
